import React from "react";
import { useParams } from "react-router-dom";
import { BsPersonFillExclamation } from "react-icons/bs";
import "./ViewReport.css"; 

const ViewProfile = () => {
  const reports = [
    { id: 1, name: "John Doe", email: "john.doe@example.com", age: 34, religion: "Christianity" },
    { id: 2, name: "Jane Mary Smith", email: "jane.smith@example.com", age: 36, religion: "Christianity" },
    { id: 3, name: "Ali Khan", email: "ali.khan@example.com", age: 29, religion: "Islam" },
    { id: 4, name: "Aisha Fatima Ahmed", email: "aisha.ahmed@example.com", age: 26, religion: "Islam" },
    { id: 5, name: "Sharjeena", email: "sharjeena@gmail.com", age: 25, religion: "Islam" },
  ];

  const { reportId } = useParams(); 
  const report = reports.find((r) => r.id === parseInt(reportId)); 


  if (!report) {
    return (
      <div className="profile-container">
        <h2>Report not found.</h2>
      </div>
    );
  }

  return (
    <div className="profile-container">
      <div className="profile-card">
        <div className="profile-header">
          <BsPersonFillExclamation className="report-icon" />
        </div>
        <div className="profile-details">
          <h2 className="user-name">{report.name}</h2>
          <p><strong>Email:</strong> {report.email}</p>
          <p><strong>Age:</strong> {report.age}</p>
          <p><strong>Religion:</strong> {report.religion}</p>
        </div>
        <div className="profile-actions">
          <button className="btn ban-user">Ban User</button>
          <button className="btn discard">Discard</button>
        </div>
      </div>
    </div>
  );
};

export default ViewProfile;
